async function GetBuff(url) {
  try {
    const response = await axios.get(url, {
      responseType: 'arraybuffer'
    });
    const base64 = `${response.data.toString('base64')}`
    const buffer = Buffer.from(base64, 'base64')
    return buffer
  } catch (err) {
    console.error(err)
  }
}
